import React from 'react';
import Header from '../Header/Header';
import UploadImage from '../../assets/images/Upload-video-preview.jpg';

function Upload() {
    return (
        <>
            <Header />
            <div className="upload-section">
                <div className="divider upload-section__divider"></div>
                <h1 className="upload-section__title">Upload Video</h1>
                <div className="upload-section__video-thumbnail">
                    <h4 className="upload-section__video-title">VIDEO THUMBNAIL</h4>
                    <img src={UploadImage}/>
                </div>
            </div>
        </>
    )
}

export default Upload;
